import { Box, Text, Image, MenuItem, Stack } from "@chakra-ui/react";

export default function Logo(props) {
  return (
    <Box {...props}>
        <Stack direction="row">
            <Image src="/zen_mastercard_logo-2.svg" /> 
            <Text fontSize="lg" fontWeight="bold" color="black">
                sasasa
            </Text>
        </Stack>
    </Box>
  );
}
